import { useNavigation, Outlet } from "react-router";

import MainNavigation from '../components/MainNavigation'

function RootLayout() {
  useNavigation()
  return (
    <>
      <MainNavigation></MainNavigation>
      <main>
        <Outlet></Outlet>
      </main>
    </>
  );
}

export default RootLayout;
